export const setCurrentUser = (user) => ({
  type: "Set_Current_User",
  payload: user,
});

export const GoogleSignInStart = () => ({
  type: "Google_SignIn_Start",
});

export const GoogleSignInSucess = (user) => ({
  type: "Google_SignIn_Success",
  payload: user,
});

export const GoogleSignInFailure = (err) => ({
  type: "Google_SignIn_Failure",
  payload: err,
});

export const EmailSignInStart = () => ({
  type: "Email_SignIn_Start",
});

export const EmailSignInSucess = (emailpass) => ({
  type: "Email_SignIn_Success",
  payload: emailpass,
});

export const EmailSignInFailure = (err) => ({
  type: "Email_SignIn_Failure",
  payload: err,
});
